- input: "TEXT\x1CC00163832\x1C2\x1C\x1CF3XN\x1CThe CSX Corporation Good Government
    Fund conducted an internal audit in connection with the transition of our PAC
    to a new vendor to ensure that the bank balance and the FEC balance reconciled.
    A single expenditure was corrected on an Amended 2008 Post-General Report, also
    filed today.  The transaction on page 207 represents the remaining difference
    between the reconciled bank balance and the FEC report balance following a review
    of our records back through 2007.  We therefore are making a one-time reconciling
    entry.  Further, in accordance with advice received from Jodi Winship in the Reports
    Analysis Division, we have adjusted our opening balance to reflect the change
    in the Amended 2008 report. Our new vendor will work in coordination with us to
    verify and maintain a monthly reconciled bank balance, so we believe we have established
    better practices for future recordkeeping and disclosure.\n"
